func Test_findMinHeightTrees(t *testing.T) {
	ast := assert.New(t)

	for _, tc := range tcs {
		// fmt.Printf("~~%v~~\n", tc)
		sort.Ints(tc.ans)
		ans := findMinHeightTrees(tc.n, tc.edges)
		sort.Ints(ans)
		ast.Equal(tc.ans, ans, "%v", tc)
	}
}

func Benchmark_findMinHeightTrees(b *testing.B) {
	for i := 0; i < b.N; i++ {
		for _, tc := range tcs {
			findMinHeightTrees(tc.n, tc.edges)
		}
	}
}
